import React, { Component } from 'react';

// upload an image

class Sell extends Component {

  constructor(props){
    super(props);
    this.state = {
      testState: ''
    }
  }

  componentDidMount(){
    console.log(`Local storage is: ${localStorage.getItem('authToken')}`);

    axios.get('http://localhost:4000/products/sell/user')
    .then( res => {
      console.log('GOT USER', res);
    })
    .catch(err => console.warn('SELL US AJAX ERROR!', err) );

  }

  render() {
    return(
      <div>
        <h3>Welcome to the sell page</h3>
        <form className="sell-form">
          <label>Sell Item</label>
          <input type="text" className="sell-input"></input>
          <input type="submit" className="sell-submit" />
        </form>
      </div>
    )
  }
}

export default Sell
